import PropTypes from "prop-types";

function Card({ image }, { titletext = "Default title" }) {
    if(!image && titletext && text){
        console.log("the elements has been required");
    }

    return <div className="card">
        <img src={image} alt="Poplloon Project" />
        <div className="card-body">
            <h4 className="card-title">{titletext}</h4>
            <p className="card-text text-secundary"></p>
        </div>
    </div>
}

Card.propTypes = {
    image: PropTypes.string.isRequired,
    titleText: PropTypes.string,
}

export default Card;
